Een X-ray bracht veel meer nierstenen aan het licht dan de vorige keer... De kans dat hij daar dus veel pijn van heeft, is heel erg groot.
Zijn urine wordt nu gecontroleerd.
Hij moet nu iedere 14 dagen voor de komende 3 maanden een antibioticaspuitje krijgen om uit te sluiten dat de steenvorming van een ontsteking komt. Daarnaast zal zijn dieet ook weer terug worden aangepast.

Ondertussen horen we voor pijnmanagement nog bij holistische/homeopathische dierenartsen wat zij aanraden.

Ik geloof in een goede wisselwerking tussen de reguliere en homeopathische geneeskunde en heb er dus alle vertrouwen in dat we een manier zullen vinden om Shaggy zo lang mogelijk een zo pijnvrij mogelijk leven te bieden.

Bedankt voor het duimen. üëçüëç

